import React from "react";
import CarouselComponent from "../components/(utils)/Carousel";

const UpComing = () => {
  <div>
    <div>
      {upComingMovie?.map((item, index) => {
        return (
          <div key={index}>
            <img src={item.primaryImage.url} alt={item.primaryImage.caption} />
          </div>
        );
      })}
    </div>
    <div>Lista</div>
  </div>;
};

export default UpComing;
